  [],\n\t\"revision_timestamp\": \"2016-03-21T18:30:24.588874\",\n\t\"name\": \"abundance-and-behavior-of-parrotfishes-labridae-scarinae-in-the-upper-florida-keys\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"To better understand the functional roles
  of parrotfishes on Caribbean reefs we documented abundance, habitat preferences,
  and diets of nine species of parrotfishes (Scarus coelestinus, Scarus coeruleus,
  Scarus guacamaia, Scarus taeniopterus, Scarus vetula, Sparisoma aurofrenatum, Sparisoma
  chrysopterum, Sparisoma rubripinne, Sparisoma viride) on three high-relief spur-and-groove
  reefs (Molasses, Carysfort, and Elbow) offshore of Key Largo in the Florida Keys
  National Marine Sanctuary. On each reef, we conducted fish surveys, behavioral observations,
  and benthic surveys in three habitat types: high-relief spur and groove (depth 2
  - 6 m), low-relief carbonate platform/hardbottom (depth 4 - 12 m), and carbonate
  boulder/rubble fields (depth 4 - 9 m).In addition, fish surveys were also conducted
  on a fourth high-relief spur-and-groove reef (French). We estimated parrotfish abundance
  in each of the three habitat types in order to assess the relative abundance and
  biomass of different species and to quantify differences in habitat selection. To
  estimate parrotfish density, we conducted 20 to 30 minute timed swims while towing
  a GPS receiver on a float on the surface to calculate the amount of area sampled.
  During a swim the observer would swim parallel with the habitat type being sampled
  and count and estimate the size to the nearest cm of all parrotfishes > 15 cm in
  length that were encountered in a 5 m wide swath. To quantify parrotfish behavior,
  approximately six individuals of each species were observed at each site for 20
  min each. Foraging behavior was recorded by a SCUBA diver while towing a GPS receiver
  (Garmin GPS 72) attached to a surface float, which obtained position fixes of the
  focal fish at 15 s intervals. Fish were followed from a close distance (~ 2 m when
  possible), and food items were identified to the lowest taxonomic level possible,
  with macroalgae and coral usually identified to genus or species. Many bites involved
  scraping or excavating substrate colonized by a multi-species assemblage of filamentous
  \"turf\" algae and crustose coralline algae (CCA). Thus, multiple species of filamentous
  algae, endolithic algae, and CCA could be harvested in a single bite, and it was
  impossible to determine the specific species of algae targeted. We also recorded
  the type of substrate targeted during each foraging bout, categorizing each substrate
  as one of the following: (1) dead coral, (2) coral pavement, (3) boulder, (4) rubble,
  or (5) ledge. Dead coral included both convex and concave surfaces on the vertical
  and horizontal planes of three dimensional coral skeletons (primarily dead Acropora
  palmata) that were attached to reef substrate. Coral pavement was carbonate reef
  with little topographic complexity (i.e., flat limestone pavement). Boulder was
  large remnants of dead mounding corals not clearly attached to the bottom and often
  partially buried in sand. Coral rubble consisted of small dead coral fragments (generally
  < 10 cm in any dimension) that could be moved with minimal force. Ledges consisted
  entirely of the undercut sides of large spurs in the high-relief spur and groove
  habitat. In order to quantify the relative abundance of different food types, we
  estimated the percent cover of algae, coral, and other sessile invertebrates on
  each of the five substrates commonly targeted by parrotfishes (dead coral, coral
  pavement, boulder, rubble, or ledge) in 0.5 m x 0.5 m photoquadrats. We photographed
  a total of 8 haphazardly selected quadrats dispersed throughout the study site for
  each substrate type at each of the three sites (N = 24 quadrats per substrate type,
  N = 120 quadrats total).  Each photoquadrat was divided into sixteen 12 cm x 12
  cm sections which were individually photographed, and percent cover was estimated
  from 9 stratified random points per section (N = 144 point per quadrat).\",\n\t\"license_title\":
